import React, {Component} from 'react';
import CardList from './CardList';
import Searchbox from './searchbox';
import {robots} from './Robots.js';

class App extends Component {
	render(){
		return(
		<div>
			<h1>RoboFriends</h1>
			<Searchbox/>
    		<CardList robots={robots}/>
    	</div>
		);
	}
}

export default App;
